import { Component } from "react";
import React from "react";
import './css/feed.css'
import { useState } from "react";

export default class Feed extends Component {
    render() {
        const [content, setContent] = useState('');

  const handleContentChange = (event) => {
    setContent(event.target.innerHTML);
  };
        return (
            <div className="feed">
                <div className="feed-container">
                    <button className="feedProfileBut">
                        <div className="feedPro">
                        <span className="material-symbols-outlined">account_circle</span>
                                <p>to anyone</p>
                        </div>
                    </button>
                    <div className="editor" contentEditable="true" role="textbox" aria-multiline="true" data-placeholder="write anything what you want" aria-label="write Post">
                        {content === '' ? <div className="placeholder">Write anything you want</div> : null}
                        <p></p>
                    </div>
                </div>
            </div>
        )
    }
}
